css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);
/* AGENT_SHEET */

#navigator-toolbox[iconsize=large][iconsize=large] #back-button > .toolbarbutton-icon {
  list-style-image: url("data:image/png;base64,")!important;
  -moz-image-region: rect(0px, 16px, 16px, 0px)!important;
}

#navigator-toolbox[iconsize=large][iconsize=large] #back-button[disabled=true] > .toolbarbutton-icon {
  opacity: 1!important;
  list-style-image: url("data:image/png;base64,")!important;
  -moz-image-region: rect(0px, 16px, 16px, 0px)!important;
}

#main-window :-moz-any(#back-button, #forward-button, #reload-button, #stop-button, #home-button, #print-button, #downloads-button, #history-button, #bookmarks-button, #bookmarks-menu-button, #new-tab-button, #new-window-button, #cut-button, #copy-button, #paste-button, #fullscreen-button, #zoom-out-button, #zoom-in-button, #sync-button, #feed-button, #alltabs-button, #tabview-button):not(:-moz-any(#alltabs-button,#tabview-button,#new-tab-button,#sync-button[status])) > .toolbarbutton-icon {
  list-style-image: url("data:image/png;base64,")!important;
}

#bookmarks-menu-button.bookmark-item,
#bookmarks-menu-button {
  list-style-image: url("data:image/png;base64,")!important;
}

.bookmark-item[container] {
  list-style-image: url("data:image/png;base64,")!important;
  -moz-image-region: rect(0px, 16px, 16px, 0px)!important;
}

.bookmark-item[container][livemark], 
.bookmark-item[container][livemark] .bookmark-item {
  list-style-image: url("data:image/png;base64,")!important;
  -moz-image-region: rect(0px, 16px, 16px, 0px)!important;
}

.bookmark-item[container][query] {
  list-style-image: url("data:image/png;base64,")!important;
  -moz-image-region: rect(0px, 16px, 16px, 0px)!important;
}
